import requests
import json

url = "http://localhost:5555/translate_file"

payload = json.dumps({
  "data": {
    "model": "Helsinki-NLP/opus-mt",
    "sourcelanguage": "en",
    "targetlanguage": "de",
    "file": ""
  }
})
headers = {
  'Content-Type': 'application/json'
}

response = requests.request("POST", url, headers=headers, data=payload)

print(response.text)
